var FsScrollAnimate=function(){let n,e;function t(){e.forEach((e,t)=>{e.getBoundingClientRect().top>n-50||function(n){n.classList.remove("fs-scroll")}(e)})}this.init=(()=>{n=window.innerHeight,e=document.querySelectorAll(".fs-scroll"),t(),document.addEventListener("scroll",t,{passive:!0})})},fsScrollAnimate=new FsScrollAnimate;fsScrollAnimate.init();